import React from 'react'
import './Header.scss';

export const Header = props => {
  return (
    <header>
    <ul>
      <li className={"li-box" + (props.isChecked ? ' move-exit-active' : '')}>
        <label>
          test
        </label>
      </li>
    </ul>
    </header>
  );
}

export default Header
